task_a_prompt:
In triangle $ABC,$ points $D$ and $E$ are on $\overline{AB}$ and $\overline{AC},$ respectively, and angle bisector $\overline{AT}$ intersects $\overline{DE}$ at $F.$  If $AD = 1,$ $DB = 3,$ $AE = 2,$ and $EC = 4,$ compute $\frac{AF}{AT}.$

[asy]
unitsize(1 cm);

pair A, B, C, D, E, F, T;

B = (0,0);
C = (5,0);
A = intersectionpoint(arc(B,4,0,180),arc(C,6,0,180));
D = interp(A,B,1/4);
E = interp(A,C,2/6);
T = extension(A, incenter(A,B,C), B, C);
F = extension(A, T, D, E);

draw(A--B--C--cycle);
draw(A--T);
draw(D--E);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, W);
label("$E$", E, NE);
label("$F$", F, SW);
label("$T$", T, S);
[/asy]

task_b_prompt:
Below is a portion of the graph of a function, $y=E(x)$:

[asy]
import graph; size(8cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-4.5,xmax=4.5,ymin=-0.99,ymax=6.5;

pen cqcqcq=rgb(0.75,0.75,0.75);
/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true);
real f1(real x){return sqrt(abs(x+1))+(9/pi)*atan(sqrt(abs(x)));}
